import React from "react";
import "./Header.scss";
export function Header() {
  return (
    <header className="headerContainer">
      <h1 className="title">EXHIBINECTION</h1>
      <div className="sign">
        <a href="/#">Sign In</a>
      </div>
      <div className="sign">
        <a href="/#">Sign up</a>
      </div>
      <div className="cart">
        <img src="./ticketIcon.svg" alt="" />
      </div>
    </header>
  );
}
